    [description] => ・ルールなどの設定は18項目!・iSWANのアプリ「大富豪しよっ!」でおなじみの3つの画面モード(スキン)も搭載しています。・キャラはアニマルモード6匹、ガールズモード6人から選べます。・アナウンスボイス有ります。【 ゲームの特徴 】◯ルール12項目+オプション6項目もある、豊富なルール設定!!地方のルールに合わせてゲームが可能です。ルール設定・三光(あり/なし)・雨四光(あり/なし)・猪鹿蝶(あり/なし)・月見酒・花見酒(あり/なし)・月見酒・花見酒の取得文数(3文/5文)・七文以上倍付け(あり/なし)・相手こいこい時倍付け(あり/なし)・手四(あり/なし)・くっつき(あり/なし)・化け札(あり/なし)・親の移行(勝者が親/交互に親)・タネ・短冊の複合(追加取得文数あり/なし)オプション設定・選択補助機能(取れない札が暗くなります)・手番のお知らせ(自分の番で効果音が鳴ります)・システムボイス(アナウンスボイスのあり/なし)・札の速さ(3段階)・残り札の表示(あり/なし)・使用する札(八八/オリジナル)・音楽設定◯3種類のゲーム画面をいつでも切替えて遊べます・シンプルモード:シンプルな画面で遊べます・アニマルモード:可愛い動物キャラで遊べます・ガールズモード:美少女キャラで遊べます~電車などで美少女キャラでプレイしにくいと思ったときはシンプルモードにチェンジ!!~◯2種類のゲームモード・フリー対戦 6ヶ月戦と12ヶ月戦で遊べます・文数争奪戦 先に相手の文数を0にした方の勝ちになります。連勝するとコスチュームが・・・◯プレイがしやすい縦画面!スマートフォン用花札アプリでは今まで無かった縦画面でのプレイができます。電車の中などでちょっと空いた時間にプレイする時、気軽に取り出してプレイできます。◯片手操作を意識して、なるべく親指で操作できるように操作ボタンを配置しています。◯キャラによって打ち筋や強さが違います。◯イカサマやカードの分配操作はしていません。◯戦績が見れます。◯BGMとSEのボリューム調整可能◯セーブは自動セーブです(自分の番になったときにセーブ)
