    [description] => 「花札しよっ!Lite」は、キャラやルールが豊富な花札こいこいが遊べる「花札しよっ!」の無料版です。 基本的な花札のルールはタイトル画面の遊び方で見れます。 【 ゲームの特徴 】 ◯3種類のゲーム画面をいつでも切替えて遊べます ・シンプルモード:シンプルな画面で遊べます ・アニマルモード:可愛い動物キャラで遊べます ・ガールズモード:美少女キャラで遊べます タイトル画面でもゲーム中のメニューからでも切り替える事ができます。 ◯ルールは以下の項目が設定されています。 ・三光(あり) ・雨四光(あり) ・猪鹿蝶(あり) ・月見酒・花見酒(あり) ・月見酒・花見酒の取得文数(3文) ・七文以上倍付け・相手こいこい時倍付け・親の移行(勝者が親) ・タネ・短冊の複合(追加取得文数あり) 詳しいルールの内容は「各種設定と説明」から見ることが出来ます。 【 有料版では12項目のルールをON/OFF可能】 ◯オプション設定では以下の項目が変更可能です。 ・選択補助機能(取れない札が暗くなります) ・手番のお知らせ(自分の番で効果音が鳴ります) ・システムボイス(アナウンスボイスのあり/なし) ・札の速さ(3段階) ・残り札の表示(あり/なし) ・使用する札(八八/オリジナル) ◯プレイがしやすい縦画面!◯片手操作を意識して、なるべく親指で操作できるように操作ボタンを配置しています。 ◯イカサマやカードの分配操作はしていません。 ◯BGMとSEのボリューム調整可能 ◯セーブは自動セーブです(自分の番になったときにセーブ) ◯ゲームは6ラウンドです。ーーーーーーー 有料版の告知 ーーーーーーーー ※有料版の「花札しよっ!」では、12項目の豊富なルール設定が出来ます。 詳細戦歴が確認できます。キャラはガールズモード6人、アニマルモード6匹から選べます。 5連勝以上するとコスチュームチェンジやおめでとう画像も・・・ーーーーーーーーーーーーーーーーーーーーーー
