    [description] => AndroTimWidget: Il tuo credito e le tue opzioni, a portata di Click!AndroTimWidget è molto più che una widget!** ATTENZIONE - A CAUSA DI PROBLEMI CON IL 40916 L'APP NON RIESCE AD INVIARE SMS DI RICHIESTA AGGIORNAMENTO - SI PREGA DI CONTATTARE IL SERVIZIO CLIENTI 119 E COMUNICARE IL DISSERVIZIO SMS DEL 40916.** IN ALTERNATIVA E' POSSIBILE UTILIZZARE L'APP VIA INTERNET: AndroTimWeb /Pro.** Chi possiede Tutto Compreso Ricaricabile / Tutto Compreso SMS ed ha ricevuto sms di errore dal 40916 è pregato di fare click su "VALORI PREDEFINITI" con il tasto MENU dalle Impostazioni.E' un servizio di aggiornamento e sincronizzazione di credito e opzioni dell'operatore mobile TIM (Telecom Italia Mobile) per RICARICABILI.SOLO nella PRO:- Filtrare gli sms indesiderati del tuo operatore.- Usare tutte le widget per controllare il credito e le opzioni attive!- Controllare il credito e le altre offerte anche all'estero.LA TUA OPZIONE NON E' SUPPORTATA? Cerca nel Market: AndroTimWeb la nuova app di elaware.it! (Supporta anche ABBONAMENTO!)*** ATTENZIONE La data e l'ora presenti in alcune widget si riferisce SOLO ed esclusivamente all'ultimo addebito avvenuto sul CREDITO, tale data ci viene comunicata da Tim tramite sms.** SE HAI PROBLEMI E' INUTILE COMMENTARE NEL MARKET: CONTATTACI VIA EMAIL! (info@elaware.it)Prima di acquistare la versione PRO ti consigliamo vivamente di provare la LITE per verificare il corretto aggiornamento delle tue opzioni.*** HandCent SMS ha impostato la massima priorità per la Ricezione SMS, pertanto AndroTimWidget NON può più funzionare in presenza di HandCent.** SOLUZIONE Per GO SMS: Rimuovere la SPUNTA (nelle Impost. di GoSMS) a "Disable other message notification, Disable other SMS related apps' notification in notification bar, avoid duplicate notifications"NB: se per caso la Tim ti ha regalato un periodo gratis di fruizione dell'opzione, ti informiamo che la Tim non fornisce aggiornamenti della tariffa via sms durante questo periodo.AndroTim Widget a differenza di altre applicazioni NON utilizza username e password o altri dati sensibili.Il servizio utilizza l'invio e la ricezione di sms gratuiti dell'operatore TIM.L'applicazione nella versione PRO è del tutto PRIVA DI PUBBLICITA'.Elaware.it non è in alcun modo affiliata con l'operatore mobile Tim, pertanto eventuali disservizi causati dall'operatore non sono imputabili alla stessa.Eventuali marchi registrati sono dei rispettivi proprietari, gli sviluppatori non sono in alcun modo associati alle seguenti società: “Telecom Italia S.p.A.”.AndroTimWidget Pro ti permette inoltre di conoscere il tuo credito residuo in tempo reale alla fine di ogni telefonata utilizzando il nuovo servizio offerto dalla Tim: InfoSMS.********CHIARIMENTI INFO SMS (dal 40033):---Per attivarlo basta inviare un SMS al 40916 con il testo INFOSMS ONIl Servizio è completamente gratuito.Con Info SMS, potrai conoscere automaticamente alla fine di ogni chiamata effettuata:1) costo chiamata2) credito residuoAndroTimWidget (PRO) filtra questi messaggi e allo stesso tempo recupera il credito residuo!******Opzioni attualmente supportate:*) Credito*) Bonus*) TimX2*) TimXTutti*) TimXTuttiItaly*) TimXSmartphone*) TimXSmartphone Senza limiti*) Internet 5GB (Normale/per Tablet)*) TimXTuttiMessaggi*) Tim TiRicarica*) Tim MegaAutoricarica*) Maxxi (Internet/Dream/iPhone) 10*) Tutto Compreso Ricaricabile (60min), VIP (120min), SMS*) Internet 40/100 Ore*) Internet 1GB per Tablet*) Tim Premia*) Tim TuttoCompreso SMS100*) MaxxiAliceNextFree*) Tutto Smartphone*) Tim Young (Dati/SMS) *) Tutto Tablet1GB ...La tua opzione non è tra le precedenti? Inviaci una mail!RICORDA: AndroTimWidget funziona attraverso l'invio(gratuito) e la ricezione di SMS da/verso il 40916, quindi se l'operatore mobile TIM non mette a disposizione un SMS da inviare al 40916 per conoscere lo stato dell'opzione attiva, allora AndroTimWidget non riuscirà a recuperarne l'aggiornamento!
