    [description] => Trova subito il distributore di benzina più economico vicino a tePrezzi Benzina (ex AndroidFuel) è l’applicazione per trovare in Italia i distributori di Benzina, Diesel, Metano e GPL con i migliori prezzi.Prezzi Benzina è un progetto collaborativo basato sulle segnalazioni del portale web Prezzi Benzina.Alcune delle funzioni che il programma offre:• Gestione di Benzina, Diesel, Metano e GPL• Visualizzazione dei benzinai in base ai dati GPS o in base ad un indirizzo inserito• Visualizzazione dei prezzi del distributore e, in caso di dati non aggiornati, visualizzazione del prezzo medio della compagnia• Navigazione con GPS verso ogni distributore• Media dei prezzi nazionali di ogni compagnia• Possibilità di inviare aggiornamenti sui prezzi• Gestione dei distributori preferiti• Installazione sulla SDSono presenti sia i distributori indipendenti ("Pompe Bianche" o "no logo") che i distributori dei grossi marchi: Eni, IP, Esso, Q8, Shell, Tamoil, TotalErg e altriPoichè i prezzi sono inseriti principalmente da volontari, non sempre sono aggiornati o disponibili; se trovi un prezzo sbagliato collabora segnalando quello corretto: la qualità del servizio migliora con la collaborazione di ogni singolo utente.Se trovi un malfunzionamento o un errore non lasciare un feedback negativo, ma scrivi a info@androidfuel.org: faremo il possibile per correggerlo.Prezzi Benzina è un marchio registrato di proprietà di DuePuntoUno S.r.l. e nasce dall'esperienza del portale PrezziBenzina.it.---Alcune note:- i colori dei distributori nella mappa variano dal verde al rosso per indicare i distributori più convenienti nella zona visualizzata. Cambiando livello di zoom i colori cambiano poiché si riferiscono alla nuova zona visualizzata- è possibile indicare i prezzi notturni o durante il week-end inserendo come tipo di servizio "Self da chiuso"- le offerte Yoodeal sono momentaneamente disabilitate per motivi tecniciSuggerimenti, commenti e bug possono essere segnalati all'indirizzo info@androidfuel.org
