Info - 2012-07-18 08:39:55 --> scraping https://play.google.com/store/apps/details?id=it.sineo.android.GhostSMS
Info - 2012-07-18 08:39:55 --> Array
(
    [app_id] => it.sineo.android.GhostSMS
    [title] => Ghostly SMS
    [author] => SINÉO
    [icon] => https://lh3.ggpht.com/_TzRzBET1VqeThPJg5yWhbVonu-xuV7FQWd_f1iNQGXD50QCY15ARz9uYDbi7WTWHA8=w124
    [description] => No more SMS messages lost!Ghostly SMS is meant to be a temporary workaround to a nasty bug in Android where the stock SMS/MMS app seems to lose some messages. It really receives them but doesn't save them, so they're kind of… lost forever!This app listens for incoming SMSs, saves them as fast as it can in an internal database (not the INBOX) and shows a notification. In order to be fast, no contact name lookup is done in the notification: as soon as the message is received, it's saved as-is.If you receive a notification from this app, but not from the stock SMS/MMS app (screenshot #2), open the activity, read your lost message and -if you wish- you can move it to your INBOX to store it or reply to it.If you don't want to move it to the INBOX or if the stock SMS/MMS app didn't lose the message (screenshot #1 and... good for you, by the way!), you can safely delete it from the internal database: no message from the INBOX is EVER deleted.More informations can be found on the homepage: http://forum.xda-developers.com/showthread.php?p=12765846If this app helps you recover a precious message you didn't want lost, consider a small donation as a token of appreciation ;-)Donations enable the following optional features:- Remove Ads- Use delayed notificationsIf you lose your donation information (i.e.: you format your device or you move to a new device) just open the app, hit the "Menu" button and select "Donations". The app will synchronize with the Market and restore every donation you made.Permissions:- SMS permissions are needed to write to the INBOX.- Read contacts is needed to show the contact name in the list.- Internet/Network is needed to show Ads. No other network communication is done.- Billing is required for donations.If you have any issues with the app, before posting a 1-star comment (I can't reply to them!) contact me on G+ (https://plus.google.com/115133497526444505927/posts) and I'll try to help. If I can't, go ahead and post a 1-star for the benefit of everyone else!
    [release_date] => 
    [rate] => 4.5
    [category] => ツール
    [price] => 0
)

