Info - 2012-07-18 08:39:56 --> Array
(
    [app_id] => it.sineo.android.camera
    [title] => Camera DCIM
    [author] => SINÉO
    [icon] => https://lh4.ggpht.com/HzlzqipKJ85vWWYHpY0cWdgB-UIMGe5M632VkXyU9evwv8A3h9HiDkl1GUSqU5W1QC0=w124
    [description] => Do you hate when iPhoto won't show the pictures you shot with your Android device, but it works fine with your friend's HTC Sense device? Why would that be?!?That's simply because Google's camera does not comply with the DCIM standard [1], used by every other Digital Camera in the world (and HTC Sense does too!)With this app, your Android device will be able to.FEATURES:- DCIM compliant digital camera- Full Gingerbread Camera, as of latest source code (Android 2.3.5)- Camera DCIM can be installed together with the official Android Camera, no overlapping issues!- Camcorder app has been unhidden and can be choosen from the application launcher (check first screenshot)- Support for Windows, Linux and Mac OS X hosts (don't worry about Thumbds.db, ._IMG0001.jpg files and so on!)- "Automagically" converts existing picture files in Camera dir to the DCIM naming.SOURCE CODE:Google has been notified of this issue on June 2009 [2] but has ignored it.I've submitted a fix for the official Android Camera on July 9th, 2011 [3] with no reply. If you are able to build your own ROM, I welcome you to download the fix and apply it to your source code! HTC has built a DCIM compliant camera, after all.If you don't know how to build your ROM, or just want it hassle-free, then this is your app.In the spirit of Open Source, all the modified source code (in addition to the original fix) is available online to whoever wishes to check it out [4][1] http://en.wikipedia.org/wiki/Design_rule_for_Camera_File_system[2] http://code.google.com/p/android/issues/detail?id=2960[3] http://code.google.com/p/android/issues/detail?id=2960#c26[4] https://github.com/hrkdroid/CameraDCIM
    [release_date] => 
    [rate] => 3.4
    [category] => 写真
    [price] => 99
)

