    [description] => O-RID KYBER for Android「KYBER」は当社独自の高精度デジタル化技術を利用した、全く新しいオンラインストレージサービスです。 KYBERは従来のOCRでは全く読めなかった手書きの文章やホワイトボードの写真などを、人間認知レベルでデジタルデータに変換することができます。 これまで手間のかかっていた大量の名刺やメモをデジタル化して、検索や管理に役立てましょう。 KYBERを使ってデジタル化: ●大切な名刺 ●手書きのメモ ●気になる記事や広告 ●会議の資料 アプリの主な機能: ●自動同期するクラウド型オンラインデータ管理 ●使いやすい名刺専用ビューワー機能 ●メールの送信先や添付データの複数選択機能 ●Evernoteや各SNSへのデータ転送機能 お知らせ: ●KYBERのご利用にはアカウント登録が必要です。 ●アカウントの初回登録特典として1,250文字分のデジタル化チケットを無料でご提供いたします。 ●名刺の撮影およびデジタル化には専用アプリ「KYBER Business Card Uploader」をご使用ください。 ※データのデジタル化にはデジタル化チケット(有料)が必要になります。ただし、下記を使用する場合はデジタル化チケットは不要です。 ・KYBER SmartCardBox ・KYBER SmartMarker ・KYBER SmartNote ・CamiApp (品番:メ-CA905-01) ・TSUBAME DIGITAL ●O-RID KYBERはAndroidの他に、WindowsやiPhoneからもご利用頂けます。●Evernoteおよびロゴは、Evernote Corporationの商標または登録商標であり、KYBERはこれらの一切の権利を保有しておりません。詳しくは当社Webページをご覧下さい。【「個人情報の標準アドレス帳読み取り」について】KYBERにあるファイルは、メールに添付して送信することができます。その際、標準アドレス帳のデータをメール送信先選択として利用させていただきます。【「現在位置の取得」について】KYBERの名刺データの住所情報からGoogleMapを表示できます。その住所までのルート検索の際に、現在位置を取得するために利用させていただきます。
