    [description] => 『Deserter's』シリーズ中の異色、女学園戦略ＳＬＧ。フィーチャーフォンにて有料版も３万本以上販売した『たくてぃかる はいすく～る』の拡張リメイク版。★日本語のみの対応です★480x800画面以上専用(720x1200画面対応)▽▲▽▲▽▲▽▲◆トラブル対応バグやトラブルに関しましては、直に作者連絡先へご連絡下さい。レビューへの書き込みですと個別のサポートが出来ません、宜しくお願い致します。◆認証の失敗について認証に失敗する場合、作者へご連絡頂ければサポート可能です。またサポートサイトの方で対処方法をまとめていますので、ご参照下さい。どうやら一番多い原因は『GooglePlay』の自動アップデート関連による、サーバーエラーらしいです。必ず誰でも発生している訳ではなく、タイミングか機種別のトラブルの様子です。▽▲▽▲▽▲▽▲◆ご購入の前のお願い有料版のご購入の前に、無料版で動作をご確認して頂く事を、強く推奨致します。動作確認が取れている機種であっても、処理速度やキー感度の感じ方には、個人差があります。納得の行くゲーム内容、納得の行く処理速度である事を、ご自身でチェックしてからのご購入をお願い致します。また本作は、無料版でもキャラ制限やターン制限はなく、最後まで遊ぶ事が出来るようになっています。有料版は、本作を気に入って下さった方や、応援して下さる方が、更に楽しむ事が出来るように多数の拡張付加要素が加わっています。◆有料版の付加要素・シナリオ増加・シャッフル機能・２周目以降にデータ引継機能・武器増加・隠しボス増加・隠し生徒キャラ増加・セーブデータ５箇所・その他▽▲▽▲▽▲▽▲戦略シミュレーション『Deserter's』シリーズ中の異色、女学園戦略シミュレーションゲーム。フィーチャーフォンにて、有料版も累計３万本以上販売した『たくてぃかる　はいすく～る』の拡張リメイク版です。▽▲▽▲▽▲▽▲◆ゲーム紹介どの身分のどの登場キャラからでも始められる、制圧型戦略シミュレーションゲーム。戦いの舞台は女学園、生徒会長の地位を狙って、生徒達の戦いが始まります。自由度が高く、敗北によるゲームオーバーが無く、何度でも復活可能、遊び方もプレイヤー次第。戦闘、謀略、友情、裏切……自由に行動して、勝組を目指して下さい。▽▲▽▲▽▲▽▲◆動作確認済機種　▼作者確認・SO-01B(Xperia) v2.1・SH-01D(AQUOS) ｖ2.3.5・SonyTabletS v3.0　▼DoCoMo・SO-02C(XPERIA acro)・SO-02D(XPERIA NX)・SC-02B(GALAXY S)・SC-02C(GALAXY S2)・SC-03D(GALAXY S2 LTE)・N-04C(MEDIAS)・N-06C(MEDIAS)・T01C(REGZA)・F-12C・F-05D(ARROWS)　▼au・IS12SH(AQUOS)・IS03・IS04(REGZA)・IS05・IS11S(XPERIA acro)・INFOBAR A01(iida)・INFOBAR C01(iida)　▼SoftBank・001HT(DesireHD)・003Z(Libero)・003SH(GALAPAGOS)・005SH(GALAPAGOS)　▼タブレット・XOOM(Motorola)・IdeaPadTabletA1(Lenovo)▽▲▽▲▽▲▽▲◆バックグラウンド処理について本アプリは、バックグラウンドに処理が回ると終了するようにプログラムしてあります。比較的重いアプリの為、常駐してバックグラウンドから他のアプリやネイティブ機能へ悪影響を与えない為です。代わりに『クイックセーブ』機能を搭載し、手軽にワンタッチで頻繁にセーブを行えるようにしていますので、そちらを有効にご利用頂けますと非常に幸いです。▽▲▽▲▽▲▽▲◆ＡｌｐｈａＮｕｔｓＧａｍｅｓファンタジー戦略シミュレーションを中心に、新作アプリを開発中です。(c) AlphaNuts / AlphaNutsGames / アルファナッツ▽▲▽▲▽▲▽▲[検索関連ワード]戦略 シミュレーション ＳＬＧ ファンタジー Des 美少女
