    [description] => フィーチャーフォンにて、シリーズ累計、数１００万ダウンロード！お手軽ファンタジー戦略シミュレーション。▽▲▽▲▽▲▽▲有料版において期間・本数限定セール実施中！７月末もしくは販売本数５０００本に達するまで９９円！（正規価格３１５円）ご興味をお持ち下さる方は是非この機会に！▽▲▽▲▽▲▽▲★高精細液晶『720x1280』対応(Ver2.0)★日本語のみの対応です。▽▲▽▲▽▲▽▲▼ゲーム紹介フィーチャーフォンにて、シリーズ累計、数１００万ダウンロード！お手軽ファンタジー戦略シミュレーション。単純操作・単純ルールで意外と奥が深い元祖Ｄｅｓｅｒｔｅｒ’ｓ復刻！操作性を最新のＮｅｏ系に改良、地形システムや戦闘システム等、システムも改良し、ゴリ押しでは難しくなりました。将の誰でもどの身分でも始められ、敗北によるゲームオーバーがなく何度でも捲土重来可能、遊び方もプレイヤー次第。力圧・智略・忠義・裏切…全ての人物がそれぞれの思考で頂点を目指します。登場将校数１１２人、変わった遊び方（一度も逃げない・一度も戦わない等）に対する称号は倍増しました。▽▲▽▲▽▲▽▲▼β版・無料版で動作報告のあった機種・SO-01B(Xperia)・SO-01C(Xperia arc)・SO-02C(Xperia acro)・SC-02C(GALAXY S2)・SC-02B(GALAXY S)・IS04(REGZA Phone)・SoftBank 001HT(Desire HD)・SoftBank 003SH(GALAPAGOS)・INFOBAR A01(iida)・T-01C(REGZA Phone)・SoftBank 003Z(Libero)・SH-03C(LYNX 3D)・SoftBank 006SH(AQUOS PHONE)・SoftBank 007SH(AQUOS PHONE)・IS11CA(G'zOne)・N-06C(MEDIAS WP)・SoftBank 005SH(GALAPAGOS)　※キーボードスライドで終了・ICONIA TAB A500(Acer)　※縦横を切り替えておく必要▽▲▽▲▽▲▽▲▼バックグラウンド処理について本アプリは、バックグラウンドに処理が回ると終了するようにプログラムしてあります。比較的重いアプリの為、常駐してバックグラウンドから他のアプリやネイティブ機能へ悪影響を与えない為です。代わりに『クイックセーブ』機能を搭載し、手軽にワンタッチで頻繁にセーブを行えるようにしていますので、そちらを有効にご利用頂けますと非常に幸いです。▼タスクキラー非推奨タスクキラー等による強制終了は考慮されておりません。メモリクリア命令がプロセスの最後に入っているのですが、途中でKILLすると、そこを通らない可能性があります。アプリ中のメニューの『終了』で綺麗に終わるように設計されています。また本体のボタンでも終了出来ます(音楽が短時間残る事があります)▽▲▽▲▽▲▽▲▼ＡｌｐｈａＮｕｔｓＧａｍｅｓファンタジー戦略シミュレーションを中心に、新作アプリを開発中です。(c) AlphaNuts / AlphaNutsGames / アルファナッツ[検索関連ワード]戦略 シミュレーション ＳＬＧ ファンタジー Des
