    [description] => フィーチャーフォンにて、シリーズ累計、数１００万ダウンロード！お手軽ファンタジー戦略シミュレーション。▼完成版がリリースされました！『AlphaNuts』か『Deserter's2DX』で検索するか、『デベロッパー情報』の『アプリケーションをもっと見る』から探して下さい。◇◆◇◆★日本語のみの対応です。★480x800画面以上専用。◇◆◇◆▼はじめに本バージョンは開発中の『β(ベータ)版』です。作者所有の旧型XPERIAにて動作確認を行い各種調整をしていますが、最新機種の処理速度だとどう動くのか確認出来ていません。宜しければお使いの機種での動作情報をご連絡頂けますと非常に幸いです。後日公開される『完成版』は、無料版でも将校制限・シナリオ制限・称号制限などはありません。◇◆◇◆▼ゲーム紹介フィーチャーフォンにて、シリーズ累計、数１００万ダウンロード！お手軽ファンタジー戦略シミュレーション。単純操作・単純ルールで意外と奥が深い元祖Ｄｅｓｅｒｔｅｒ’ｓ復刻！操作性を最新のＮｅｏ系に改良、地形システムや戦闘システム等、システムも改良し、ゴリ押しでは難しくなりました。将の誰でもどの身分でも始められ、敗北によるゲームオーバーがなく何度でも捲土重来可能、遊び方もプレイヤー次第。力圧・智略・忠義・裏切…全ての人物がそれぞれの思考で頂点を目指します。登場将校数１１２人、変わった遊び方（一度も逃げない・一度も戦わない等）に対する称号は倍増しました。◇◆◇◆▼動作報告のあった機種・SO-01B(Xperia)・SO-01C(Xperia arc)・SO-02C(Xperia acro)・SC-02C(GALAXY S2)・SC-02B(GALAXY S)・IS04(REGZA Phone)・SoftBank 001HT(Desire HD)・SoftBank 003SH(GALAPAGOS)・INFOBAR A01(iida)・T-01C(REGZA Phone)・SoftBank 003Z(Libero)・SH-03C(LYNX 3D)・SoftBank 006SH(AQUOS PHONE)・IS11CA(G'zOne)・SoftBank 005SH(GALAPAGOS)　※基本動作は問題なし　※キーボードスライドで終了してしまう・ICONIA TAB A500(Acer)　※縦横を切り替えておく必要有り◇◆◇◆★バージョン３．１・マップ選択時の選択処理の誤りを訂正・初期勢力での兵士レベルプラス調整機能付加☆バージョン３．０・キー関連バグを多数修正☆バージョン２．５・稀に上下左右キーが押しっ放しになるバグを修正☆バージョン２．４・決戦戦闘の表示バグを修正☆バージョン２．３・テキスト系の修正☆バージョン２．１・キー感度(『○』『×』)を向上☆バージョン２．０・フォント(文字)の解像度アップ・効果音とＢＧＭの個別オンオフ機能☆バージョン１．２・要望により『○』『×』ボタンを大きくしました☆バージョン１．１・マニュアルの誤表示を修正◇◆◇◆▼バックグラウンド処理について本アプリは、バックグラウンドに処理が回ると終了するようにプログラムしてあります。比較的重いアプリの為、常駐してバックグラウンドから他のアプリやネイティブ機能へ悪影響を与えない為です。代わりに『クイックセーブ』機能を搭載し、手軽にワンタッチで頻繁にセーブを行えるようにしていますので、そちらを有効にご利用頂けますと非常に幸いです。◇◆◇◆▼ＡｌｐｈａＮｕｔｓＧａｍｅｓファンタジー戦略シミュレーションを中心に、新作アプリを開発中です。(c) AlphaNuts / AlphaNutsGames / アルファナッツ[検索関連ワード]戦略 シミュレーション ＳＬＧ ファンタジー Des
