    [description] => AKB48、SKE48、NMB48、HKT48、乃木坂46のプロフ、ブログ、Google＋、Twitter、Facebook、AKBまとめブログ更新情報を搭載AKB48、SKE48、NMB48、HKT48、乃木坂46の更新情報をすべて網羅した、AKB48リーダーアプリ決定版「AKB神まとめ」！！総選挙速報&情報もこのアプリで即チェック！AKB関連のメンバープロフ、オフィシャルブログ、ファンによるまとめブログ、Google＋、Twitter、Facebook、このアプリ一つで、AKB関連の更新情報を一括で把握することができます。※やすす（秋元康先生）のぐぐたすももちろん網羅！ver1.5でお気に入りメンバーブログのウィジェット、ブログの未読既読の機能を追加しました。ver1.4.1でGoogle+、TwitterアイコンをGoogle+、Twitterプロフィール画像かアプリ内のアイコンかを選択できるようにしました。ver1.3.3でGoogle+の動画閲覧ができるようになりました。ver1.3.1でGoogle+にメンバーコメント表示機能を追加しました。ver1.3で日付検索とキーワード検索ができるようになりました。ver1.1でスケジュールを確認できるようになりました。★顔写真表示★ブログ更新情報とともにメンバーの顔写真が表示されるのでわかりやすい！★ブログ画像の保存可能！★ブログ、Google＋の掲載画像はすべてSDカードに画像保存可能！！※ブログ記事内の画像は長押しして保存を押して下さい。※Google+の画像は画像部分を押すと、画像ビューワーが開き、大きな画像を見れて、保存ボタンを押すとSDカードに保存できます。（保存先は、SDカードのdownloadフォルダです）※横向きの画像等は、画像ビューワーで画像の向きを変えてから保存できます★推しメンカスタム★好きなメンバーをお気に入り登録しておけば、推しメンの更新情報だけをすぐに確認できます！★AKBだけじゃない！★AKB48、SKE48、NMB48、HKT48、乃木坂46までこのアプリ一つで網羅しています！★かゆいところに手が届く設計！★サイト一覧では、グループ順、名前順、更新時刻順に並べかえが可能！その他、記事をツィートする機能、キャッシュの設定、ブログをスマホページで開くかPC用ページで開くか、、などなど。日付検索、キーワード検索では、ブログ、ニュース、Google+、Twitter毎に検索が可能です。このリーダーアプリはあなた好みに細かく設定可能です！＜掲載メンバーブログ＞・AKBオフィシャルブログ（AKB48TOKYO DOMEまでの軌跡）・ノースリーブス・渡り廊下走り隊・DiVA（AKB48 TEAM A）・岩佐美咲／大家志津香／片山陽加／倉持明日香／指原莉乃／篠田麻里子／高城亜樹／中田ちさと／仲谷明香／前田敦子／前田亜美／松原夏海（AKB48 TEAM K）・秋元才加／板野友美／内田眞由美／梅田彩佳／大島優子／田名部生来／中塚智実／仁藤萌乃／野中美郷／藤江れいな／松井咲子／宮澤佐江（AKB48 TEAM B）・石田晴香／河西智美／柏木由紀／北原里英／小林香菜／小森美果／佐藤亜美菜／佐藤すみれ／佐藤夏希／鈴木まりや／近野莉菜／増田有華／宮崎美穂・SKE48オフィシャルブログ・NMB48オフィシャルブログ・HKT48オフィシャルブログ・乃木坂46オフィシャルブログ・乃木坂46運営スタッフオフィシャルブログ（乃木坂46）・生田絵梨花／安藤美雲／生駒里奈／市來玲奈／伊藤寧々／伊藤万理華／井上小百合／岩瀬佑美子／衛藤美彩／柏幸奈／川後陽菜／川村真洋／齋藤飛鳥／斎藤ちはる／斎藤優里／桜井玲香／白石麻衣／高山一実／中田花奈／中元日芽香／永島聖羅／西野七瀬／能條愛未／橋本奈々未／畠中清羅／樋口日奈／深川麻衣／星野みなみ／松村沙友理／宮澤成良／大和里菜／若月佑美／和田まあや＜掲載ニュース・まとめブログ＞・AKBまとめんばー・Daily AKB48・Daily SKE48・Daily NMB48・Daily HKT48・AKB48LOVER・AKB48れんらく帳・SKE48まとめ・AKBωタメ・AKBまとめ同盟・AKB48タイムズ・AKB48情報まとめたった・AKB48er・AKBエンタメクラスタ・G−ラボ・もわっっ。・乃木坂46まとめブログ〜上り坂〜・AKB48速報・執拗にAKB見られるGoogle+・AKB、SKE、NMB、HKT正規メンバー全員・秋元康、戸賀崎智信、湯浅洋、金子剛、佐藤和也、茅野しのぶ、西山恭子、大島森、北川謙二見られるTwitter・小嶋陽菜／篠田麻里子／秋元才加／板野友美／梅田彩佳／仁藤萌乃／石田晴香／河西智美／