    [description] => Keep private text messages secure, with password protected hidden mail box.
*** Completely stealth, there is no app icon in your app list.<br>*** Nobody else can see the app or open it except you.


Privacy security features:


*Password protection: hidden mail box with no app icon, can't be seen or opened by other people. <br>*Unlimited private list:  add as many numbers as you want.<br>*Remote clear: you can clear everything in the mail box including the private list remotely with a text message to your phone. <br>*Hidden widget:  only visible when there is new message, will disappear again when message is read.<br>*Sneak up guard:  provides protection against people who sneaks up on you, a sudden move of the phone will close the mail box immediately.<br>*Force open protection:  secret password that can clear the mail box before opening it or open another app instead of hidden mail box. <br>*Mail box time out:  set a timer to close the mail box.<br>*Move old messages:  from regular mail box to hidden mail box, messages will be erased from regular mail box, and can NOT be moved back to regular mail box.


*** Also check out our best-selling Extreme Call Blocker app, with private sms box built-in, plus complete call/message blocking features. <br>https://play.google.com/store/apps/details?id=com.greythinker.punchback


