【JBpressとは】<br>JBpressは、経営者・マネジメント層、ビジネスパーソンに向けて、本質的で深い分析に基づいた記事を提供しています。とりわけ日本のメディアがあまり重視してこなかった「海外情報」と「地方情報」に力を入れています。また、日本を再生させなければならないという観点から、政治、経済だけでなく社会制度や生き方についても問題提起してまいります。<br><a href="http://www.google.com/url?q=http://jbpress.ismedia.jp&amp;usg=AFQjCNHXa05nboV8HGZkFRG_BNrk609gxA" target="_blank">http://jbpress.ismedia.jp</a>


