    [description] => 怪盗ロワイヤルで一括ウィンク、コメントを実行するツール
3/25<br>ログイン情報保持かつ、ログイン情報が存在する場合は、タイムアウトメッセージ出力までWEBアクセスしていないので、タイムアウトは発生しないはずです。<br>上記条件で、タイムアウトが発生する場合はご連絡下さい。<br>※毎回ログインしている人は、WEBアクセスしているので、タイムアウトが発生する可能性があります。


2/25<br>何度もアクセスすると番号認証が入る修正が入ったようです。<br>そうなるとツールではログインできません。<br>WEBで番号認証をクリアし手動ログイン後、接続情報を保存して実行をして下さい。<br>動く絵文字対応とログインタイムアウト問題として、ログイン処理の見直しとタイムアウト値の変更を行いました。<br>ログインできない場合は、WEBログイン機能でログイン情報を保存して実行をお願いします。


1/21<br>ログイン判定の修正。


12/15<br>ログイン確認時にタイムアウトとなると、報告がありましたが、こちらの環境では全く発生しません。<br>暫定で対応しましたが、効果のほどは不明です。


11/25<br>ログイン情報が存在しない状態で、ログインを実行した場合、タイムアウトし、ログインできない問題の対応。<br>v1.11.22にアップデートもしくは、WEBログインでログイン情報を作成する事で回避可能。


11/22<br>WEBログイン機能の追加。<br>ログインできない方向けにWEBログインを用意しました。<br>設定画面のWEBログイン設定を使用し、WEB画面からログイン後、そのログイン情報を保存し、実行できるようにしました。<br>また、速度改善になるかは不明ですが、接続方式を変更しました。


11/21<br>エラーコード：E2300はログイン画面が取得できないエラーです。<br>モバゲー側のなんらかの規制だとすると、ログイン保持機能を使用する、もしくはしばらく時間を置いてからアクセスするしか回避できません。<br>どのような状況で使用しているか、詳細をお願いします。<br>複数アカウント使用（ユーザ数）、接続方式Wi-Fiなど


毎回発生するようなら、ブラウザーでログイン画面が開けるか試してください。


11/9 v1.10.20でさらにログインできない方向けに対応しました。<br>アドレス、パスワードエラー以外にタイムアウトエラーを出力できるように<br>変更しました。


11/8 v1.10.19で暫定対応しました。<br>こちらの環境では発生しなくなりましたが、あくまで暫定対応なので、事象が発生した方のみ適用して下さい。


11/7 アップデート後、ログインできないと書込みがありますが、ログイン機能に関しては変更していないので原因不明です。


調査した結果、確かに毎回ログインの場合、ログインできる場合とそうでない場合があるようです。<br>数分あけて、実行するとうまくいったりしますが、確実ではないです。<br>原因は調査中ですが、ログイン保持機能を使用した場合は、再現していません。


10/16 v1.10.17 正式版リリース。


8/7 仕様変更が多発しているようです。<br>     使用には十分注意して下さい。


6/20コメント機能対策されました。<br>v1.6.7以降のバージョンで対応しましたがまた対応される可能性ありです。


ツールの使用、設定に関しては<a href="http://www.google.com/url?q=http://ameblo.jp/kaisyu0402/%25E3%2581%25A7%25E3%2581%2594%25E7%25A2%25BA%25E8%25AA%258D%25E4%25B8%258B%25E3%2581%2595%25E3%2581%2584&amp;usg=AFQjCNHtCUsQsTlule8xKbnD2avl6N415w" target="_blank">http://ameblo.jp/kaisyu0402/でご確認下さい</a>。


【機能】<br>・一括ウィンク、コメント機能<br>・怪盗仲間一括登録機能<br>・怪盗仲間個別登録機能<br>・怪盗仲間参照削除機能<br>・履歴参照削除機能


【1.14系追加機能】<br>・コメント履歴一覧画面の追加


【1.13系追加機能】<br>・コメント履歴機能の追加


【1.12系追加機能】<br>・ログイン情報削除機能の追加<br>  WEBログイン画面からログイン情報を削除できるようにしました。<br>・実行状況画面更新時間設定機能の追加<br>　実行状況画面の情報更新時間を設定できるようにしました。<br>　これにより実行中の負荷が軽減できます。<br>・実行状況画面の更新ボタンの追加<br>　手動で実行状況画面を更新できるようにしました。


【1.11系追加機能】<br>・WEBログイン画面の追加<br>  設定画面の専用WEB画面からログイン後、menu ボタンのログイン情報保存を実行することにより、ログイン情報を保存できるようにしました。<br>  ユーザ登録時も同様に実行状況画面でステータスを確認できるようにしました。<br>　接続方式の変更


<br>【1.10系追加機能】<br>・コメントチェック機能の追加<br>　※コメントチェック機能を使うことにより、同日のコメントの存在有無をチェックし、コメントを上書きしないようにします。


【1.9系追加機能】<br>・ウィンク再開機能の追加<br>　※前回実行が正常終了でない場合、再度実行した際に確認ダイアログに「再開」ボタンが表示され、再開を選択すると、エラー時のユーザからウィンクを再開します。


<br>【1.8系追加機能】<br>・ログイン情報保持機能の追加<br>　（ONにすると、ブラウザー同様、前回のログイン情報を使用して、実行します。）<br>　※複数アカウントを使用する場合は、動作確認環境がないので、非推奨。


【1.7系追加機能】<br>・アカウント管理機能の追加


<br>【1.6系追加機能】<br>・設定画面にスリープ設定を追加<br>　（ONにすると、プロセス実行中、実行状況画面を表示中はスリープ状況にならないようになります。）<br>・実行状況画面に停止ボタンを追加。<br>　（プロセスを途中停止できるように、実行状況画面に停止ボタンを追加）


【1.5系追加機能】<br>リトライ設定機能<br>（設定した0～3回の間でリトライ可能にしました。初期値は未設定でリトライなし）<br>　[仕様変更]<br>　・コメントの入力実行の際にエラーとなった場合の動作を変更<br>　　　エラー → 実行状況でエラー内容を表示し続行


【1.4系追加機能】<br>・実行状況確認画面の追加<br>（menuの実行状況から確認）


【1.3系追加機能】<br>・仲間ウィンク機能<br>　設定画面で設定する事で仲間のみウィンク実行可能<br>・ウィンク実行数設定機能<br>　設定画面で最大ウィンク人数を設定できるようにしました。(最大100人まで)<br>・実行制御<br>　履歴を削除することで再実行可能でしたが、履歴を削除しても再実行不可にしました。<br>・コメント置換機能<br>@name@を怪盗名へ変換します。(＠は全角半角どちらも許容)<br>怪盗モバゲーへのウィンク例<br>[設定値]<br>@name@さん今日もがんばっていきましょう。<br>↓[実際に登録されるコメント]<br>モバゲーさん今日もがんばっていきましょう。<br>↑<br>先頭の怪盗は削除されます。


【1.2系追加機能】<br>menuボタン押下時に表示されるmenuに機能を追加<br>・履歴一括削除機能<br>・ユーザ一括削除機能<br>・設定初期化機能


【1.1系追加機能】<br>・コメント有無、ウィンク停止設定機能<br>(ユーザ一覧でユーザ長押しで設定画面を表示し設定)<br>・ユーザ登録時コメント有無デフォルト設定機能<br>(menu設定画面でユーザ登録時のコメント有無を設定)


【FAQ】<br>・強制終了する？<br>　→以下４点に気を付けて実行してみて下さい。<br>　１タスクキラーなど入れていないか確認してください。<br>　２ネットワークが通常時切断されない状況で実行してください。<br>　３ウィンク実行中モバゲーに接続しないでください。<br>　４機種によっては待機中にアプリが停止してしまうので、待機モードにならないように注意して下さい。<br>（003SHはネットワーク接続など動作が不安定などの不具合が報告されている機種です。OS自身に原因がある場合は対応できかねます。）


<br>・正常終了してもウィンクPがたまっていない。<br>　→すでにウィンク実行済みか、接続タイムアウトが多発している可能性がありますので、まずは電波が安定した状態で実行をお願いします。<br>　　（v1.4系から実行状況画面で接続タイムアウトを表示してますので、接続タイムアウトを確認する事もできるようになりました）


・アプリを落としてもウィンク実行されるのか？<br>　→もともとウィンクを実行して、homeボタン、戻るボタンでアプリを終了させて、インターネット、メールをしている間にポイントを貯めるという、思想で作っていますので、実行後アプリを終了しても大丈夫です。


・ツールのアクセスするURLについて、数名からメールアドレス、パスワードを変なサイトに送っていないかと問い合わせがありました、tcpdumpなどを使用することで、パケットキャプチャしアクセスを確認できるかと思われます。<br>心配な方はご使用を避けるか、上記方法などで確認をお願いします。


・個別登録の際に設定する怪盗IDは対象の怪盗ページを表示した際のURLを表示し、そのURL内にある『K=』の後にある数値になります。<br>（詳細は『怪盗ID』で検索して下さい。）


【今後の追加機能（予定）】


